import { Button } from "@material-ui/core";

import SignIn from "./SignIn";
import SignUp from "./SignUp";


const Home = () => {

    const [pageNav, setPageNav] = useState({
        signUp: false
    })

    if (!pageNav.signUp)

    return (
        <div>
            <Button onClick={()=> setPageNav({ signUp: true })}>Click Here to create an account!</Button>
            <SignIn /> 
        </div>

    )

    return (
        <div>
            <SignUp />
            <SignIn />
        </div>

    )

}

export default Home;
